INSERT INTO `manufactures` (`manufacturer_id`, `name`, `description`, `img`) VALUES
(1, 'Rehau', 'Система шумопоглощающей канализации RAUPIANO\r\nС канализацией RAUPIANO вы не услышите шум воды в трубах\r\nКанализационная система REHAU превышает нормы Германии по звукоизоляции на 60 %. Подтверждено исследованиями Института строительной физики им. Фрауэнхофера в г. Штутгарт.\r\nВысокая надежность\r\nВы можете быть абсолютно уверены в надежности системы RAUPIANO PLUS. Простая техника соединения в сочетании со встроенными муфтами и установленными на производстве уплотнительными кольцами гарантирует отсутствие протечек и неприятного запаха.\r\nЗапатентованная технология крепления труб\r\nВы можете быть абсолютно уверены в надежности системы RAUPIANO PLUS. Простая техника соединения в сочетании со встроенными муфтами и установленными на производстве уплотнительными кольцами гарантирует отсутствие протечек и неприятного запаха.\r\nБезупречно вписываются в современный интерьер\r\nТрубы RAUPIANO Plus идеально белого цвета. В местах открытого монтажа они не привлекают внимания, в отличие от традиционных серых канализационных труб.\r\nДолговечны\r\nСрок службы системы — минимум 50 лет. Вам не придется устранять протечки или делать капитальный ремонт с заменой труб.\r\nГарантировано надежны\r\nСистема устойчива к старению, коррозии и высоким температурам, а гладкая внутренняя поверхность исключает появление отложений на протяжении всего срока службы.\r\nВысокая пожаробезопасность\r\nПротивопожарная защита RAUPIANO удовлетворяет строительным нормам и правилам и обеспечивает высокую степень безопасности. При температуре 120°С противопожарная манжета полностью перекрывает трубу и блокирует распространение огня и дыма в другие помещения.\r\n', );
INSERT INTO `manufactures` (`manufacturer_id`, `name`, `description`, `img`) VALUES
(2, 'Makel', 'Группа предприятий «Makel» начала свою деятельность в секторе электроприборов и материалов в 1977 году. Данная группа, основанная исключительно на турецком капитале, с успехом ввела много новшеств в данный сектор. «Makel», являясь одной из лидирующих фирм рынка, на протяжении долгих лет обладает статусом лидера по экспорту электроматериалов в Турции и с помощью самых современных технологий экспортирует свою продукцию в более чем 70 стран мира.\r\n«Makel», изготавливающая свою продукцию на фабрике площадью 45 тыс.м2 в соответствии с мировыми стандартами и при использовании самых современных технологий и автоматизированных систем, предлагает широкий выбор продукции, а именно: выключатели - розетки, групповые розетки, автоматические выключатели, коробки с предохранителями, выключатель для защиты от утечки тока, компактные выключатели с защитой от утечки тока, электронные счетчики, контроль мощности, панели и светодиодное освещение. \r\nБлагодаря успешным продажам на международном рынке с 1990-ых. гг. и политике маркетинга фирму «Makel» предпочитают во многих странах мира за высокое качество, цену и обслуживание после покупки товара. Фирма входит в Программу поддержки марок «Turquality», созданную Министерством экономики с целью оказания поддержки маркам, продвигающимся на пути к мировому статусу. Благодаря данной программе «Makel» сегодня экспортирует свою продукцию в более чем 70 стран мира, а также планирует дополнять этот список другими странами и другими континентами.\r\nФирма, сумевшая превысить в 2011 году намеченные результаты как на турецком, так и во внешних рынках, продолжает уверенный рост и развитие, придерживаясь намеченной цели - предоставляя партнерам и конечным потребителям лучшее качество по лучшей цене. Группа предприятий «Makel», обеспечившая около 550 рабочих мест, привлекает внимание также мерами по повышению образования и благополучия своих сотрудников. Продолжая активные действия в области научно-исследовательских разработок при поддержке инженеров и техников, занимающихся обеспечением качественной продукции, которая оправдает ожидания потребителей, фирма с каждым годом ускоряет работы и исследования, направленные на достижение самого высокого качества наместном и зарубежном рынках.\r\n', );
INSERT INTO `manufactures` (`manufacturer_id`, `name`, `description`, `img`) VALUES
(3, 'Kahrs', 'За плечами Kährs более чем 160-летний опыт работы с древесинной. Сегодня мы являемся одним из старейших в мире и самым инновационным производителем многослойного паркета.\r\nИстория Kährs наполнена целыми поколениями инновационных разработок, которые оказали влияние на индустрию паркетных полов по всему миру - от изобретения многослойной доски до бесклеевой замковой системы Woodloc®.\r\nМы постоянно обсуждаем пути,  как сделать наши полы еще лучше. В процессе работы мы экспериментируем, тестируем,  и в конечном итоге достигаем успеха. Цель одна: сделать наши полы ещё красивее, прочнее, стабильнее, а их установку – ещё проще.\r\n\r\nМы гордимся тем, что люди во всем мире высоко оценивают результаты наших усилий.  Сегодня наши полы можно увидеть в домах, офисах, магазинах, отелях, концертных залах, театрах и на спортивных объектах по всему миру: от Европы и Азии до Северной и Южной Америки.\r\nKährs поставляет паркетную доску в более чем 70 стран по всему миру и удерживает лидирующие позиции на рынке паркета в Швеции, а также играет ведущие роли на рынках Европы и Великобритании. \r\nГруппа Kährs – мировой инновационный лидер в производстве деревянных и эластичных напольных покрытий.\r\n', ),
(4, 'Caparol', 'Сильный партнер для розничной торговли, торговли, проектировщиков и архитекторов\r\nDAW BENŢA Молдова является представителем в Молдове немецкого концерна DAW SE – европейского лидера на рынке строительной отделки. Компания реализует бренды CAPAROL, CAPATECT, ALPINA и DISBON. Ассортимент производимой и реализуемой продукции охватывает сектор моющихся красок для внутренних и наружных работ, грунтовок, структурированных штукатурок, лаков и лаков, обоев и специальных декоративных продуктов, эпоксидных красок для пола, компьютеризированных систем колеровки красок, лаков и штукатурок.\r\n\r\nМиссия компании DAW BENŢA Молдова заключается в том, чтобы посредством ассортимента продукции, объединенной под брендом CAPAROL, люди чувствовали себя намного комфортнее и безопаснее в помещениях, где они живут или работают, когда Caparol украшает и защищает их.', );
INSERT INTO `manufactures` (`manufacturer_id`, `name`, `description`, `img`) VALUES
(5, 'Lafarge', 'Lafarge SA — французская компания, крупный производитель строительных материалов. Предприятия группы Lafarge производят цемент (крупнейший производитель в мире), бетон и его заполнители, кровельные материалы, гипс. Предприятия компании расположены в 78 странах мира.\r\nИстория компании началась в 1833 году в городке Ле-Тей (департамент Ардеш) когда её основатель Огюст Павен де Лафарж начал разработку известняка и производство извести. Компания была поставщиком материалов для строительства Суэцкого канала. Уже к 30-м годам XX века компания стала крупнейшим производителем цемента во Франции, а к концу века — и в мире.\r\n\r\nОтвечая на вызовы современности, LafargeHolcim создает универсальные и инновационные продукты для индивидуального домостроения и крупных инфраструктурных проектов: цементы, заполнители, товарные бетонные смеси. Собственные лаборатории и технические центры в регионах мира позволяют компании предвосхищать тренды в строительной индустрии.\r\n\r\nLafargeHolcim — это команда профессионалов, высокие технологии и отлаженный процесс производства. Компания предлагает широкий спектр высококачественных и экологичных строительных материалов технологий клиентам по всему миру независимо от масштаба задачи: от частного домостроения до крупных инфраструктурных проектов. Компания намерена занять ведущие позиции в цементной индустрии по снижению уровня выбросов углерода и переходу к низкоуглеродному строительству. LafargeHolcim располагает одним из сильнейших в отрасли научно-исследовательским центром.\r\n', );

